import React, { useState, useEffect  } from 'react';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { ReportData } from '../types';
import { CopyIcon } from './icons/CopyIcon';
import { DownloadIcon } from './icons/DownloadIcon';

interface ReportDisplayProps {
  data: ReportData;
  onReset: () => void;
}


const ReportDisplay: React.FC<ReportDisplayProps> = ({ data, onReset }) => {
  const [copyStatus, setCopyStatus] = useState<'idle' | 'copied'>('idle');
  const [reportData, setReportData] = useState<ReportData>(data);
  // const [bloqueo, setBloqueo] = useState<string>('');
  const [tipoMovimiento, setTipoMovimiento] = useState<string>('');
  //const isCese = !!data.motivoDeCese;

  useEffect(() => {
    setReportData({ ...data, cc: data.cc || '' });
    //setBloqueo('');  Limpia el bloqueo en cada nueva carga
  }, [data]);

 /*   useEffect(() => {
    if (isCese && tipoMovimiento.includes("CON LICENCIA")) {
      setBloqueo("No corresponde Bloqueo por ser un cese con Licencia");
    } else if (isCese && !tipoMovimiento.includes("CON LICENCIA")) {
      setBloqueo("");
    }
  }, [tipoMovimiento, isCese]); */

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>, field: keyof ReportData) => {
    setReportData({ ...reportData, [field]: e.target.value });
  };

  const handleCopy = () => {
    if (!reportData.cc) {
      alert("Debe ingresar un código de cargo.");
      return;
    }
    //const mainActionLabel = isCese ? "Motivo de Cese" : "Reemplaza a";
    //const mainActionValue = isCese ? data.motivoDeCese : data.reemplazaA;
    const dateLabel = "Fecha de alta";

    let reportText = `
Informe ABM
Movimiento: ${tipoMovimiento}
Nº de Expediente: ${reportData.expediente}
Establecimiento: ${reportData.establecimiento}
Teléfono: ${reportData.telefono}
Delegación: ${reportData.delegacion}
Repartición: ${reportData.reparticion}
CUIL: ${reportData.cuil}
Rol: ${reportData.rol}
Apellido y Nombre: ${reportData.apellidoYNombre}
Situación de revista: "Titular"
${dateLabel}: ${reportData.fecha}
CC: ${reportData.cc}
Cargo a cubrir: ${reportData.cargoACubrir}
Concurso: ${reportData.concurso}
Resolución: ${reportData.resolucion}


`.trim().replace(/^\s+/gm, '');

/*${mainActionLabel}: ${mainActionValue}*/

     /* if (isCese && bloqueo) {
        reportText += `\nBloqueo: ${bloqueo}`;
    } */

    navigator.clipboard.writeText(reportText).then(() => {
      setCopyStatus('copied');
      setTimeout(() => setCopyStatus('idle'), 2500);
    });
  };

  const handleDownloadPdf = () => {
    if (!reportData.cc) {
      alert("Debe ingresar un código de cargo.");
      return;
    }
    const doc = new jsPDF();
    //const isCese = !!reportData.motivoDeCese;

    const logoBase64 = "data:image/png;base64,";

    // (x, y, width, height)
    doc.addImage(logoBase64, "PNG", 170, 10, 20, 20);

    doc.setFontSize(18);
    doc.text("Informe ABM", 14, 22);

    const tableData = [
      ["Movimiento", tipoMovimiento],
      ["Nº de Expediente", reportData.expediente],
      ["Establecimiento", reportData.establecimiento],
      ["Teléfono", reportData.telefono],
      ["Delegación", reportData.delegacion],
      ["Repartición", reportData.reparticion],
      ["CUIL", reportData.cuil],
      ["Rol", reportData.rol],
      ["Apellido y Nombre", reportData.apellidoYNombre],
      ["Situación de revista", reportData.situacionDeRevista],
      ["Fecha de alta", reportData.fecha],
      ["CC", reportData.cc],
      ["Cargo a cubrir", reportData.cargoACubrir],
      ["Concurso", reportData.concurso],
      ["Resolución", reportData.resolucion]
     /*  isCese 
        ? ["Motivo de Cese", reportData.motivoDeCese] 
        : ["Reemplaza a", reportData.reemplazaA],
        ...(isCese ? [["Bloqueo", bloqueo]] : []), */
    ].filter(row => row[1]); // Filter out rows with empty values

    autoTable(doc, {
      startY: 30,
      head: [['Campo', 'Valor']],
      body: tableData,
      theme: 'grid',
      styles: {
        cellPadding: 2,
        fontSize: 10,
      },
      headStyles: {
        fillColor: [30, 64, 175],
        textColor: 255,
        fontStyle: 'bold',
      },
      columnStyles: {
        0: { fontStyle: 'bold', cellWidth: 50 },
        1: { cellWidth: 'auto' },
      },
    });

    doc.save(`Informe ABM-${data.apellidoYNombre.replace(/\s/g, '_')}-${data.cuil}.pdf`);
  };

  const movimientoOpciones = [
    "TOMA DE POSESIÓN EFECTIVA - TITULAR",
    "TOMA SIMBÓLICA - TITULAR",
    "PRÓRROGA - TITULAR",
    "NO TOMA DE POSESIÓN- TITULAR",
  ];

  const renderEditableItem = (label: string, field: keyof ReportData) => (
    <div className="py-3 px-4 bg-gray-800 rounded-md">
      <label className="text-sm font-medium text-gray-300">{label}</label>
      <input
        type="text"
        value={reportData[field] as string}
        onChange={(e) => handleInputChange(e, field)}
        className="mt-1 w-full text-md text-white font-semibold break-words bg-transparent border-none focus:outline-none"
        placeholder={field === 'cc' ? "Campo obligatorio..." : ""}
      />
    </div>
  );


  return (
    <div className="w-full animate-fade-in">
      <div className="bg-white dark:bg-gray-900 p-6 rounded-lg shadow-md">
      <div className="flex justify-between items-center mb-4 border-b pb-3 border-gray-200 dark:border-gray-700">
        <h2 className="text-2xl font-bold text-brand-dark dark:text-white">
        Informe ABM
        </h2>
        <div className="flex items-center space-x-2">
        <button
          onClick={handleCopy}
          className={`flex items-center space-x-2 px-4 py-2 text-sm font-semibold rounded-lg transition-all duration-200 ${
          copyStatus === 'copied'
            ? 'bg-green-100 text-green-700 dark:bg-green-900 dark:text-green-300'
            : 'bg-brand-light text-brand-primary hover:bg-blue-200 dark:bg-gray-800 dark:text-blue-300 dark:hover:bg-gray-700'
          }`}
        >
          <CopyIcon className="w-5 h-5" />
          <span>{copyStatus === 'copied' ? 'Copiado!' : 'Copiar texto'}</span>
        </button>
        <button
          onClick={handleDownloadPdf}
          className="flex items-center space-x-2 px-4 py-2 text-sm font-semibold rounded-lg transition-all duration-200 bg-brand-light text-brand-primary hover:bg-blue-200 dark:bg-gray-800 dark:text-blue-300 dark:hover:bg-gray-700"
        >
          <DownloadIcon className="w-5 h-5" />
          <span>Descargar PDF</span>
        </button>
        </div>
      </div>
      <dl className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {/* <dt className="text-sm font-medium text-gray-300">Tipo de Movimiento</dt>
        <div className="md:col-span-2 lg:col-span-3">
          <div className="py-3 px-4 bg-gray-800 rounded-md">
            <input
              list="movimiento-opciones"
              type="text"
              value={tipoMovimiento}
              onChange={(e) => setTipoMovimiento(e.target.value)}
              className="mt-1 w-full text-md text-white font-semibold break-words bg-transparent border-none focus:outline-none"
              placeholder="Selecciona o escribe..."
            />
            <datalist id="movimiento-opciones">
              {movimientoOpciones.map((opcion) => (
                <option key={opcion} value={opcion} />
              ))}
          </div>
        </div>
            </datalist> */}
        
        {renderEditableItem("Movimiento", "tipoMovimiento")}
        {renderEditableItem("Nº de Expediente", "expediente")}
          {renderEditableItem("Establecimiento", "establecimiento")}
          {renderEditableItem("Teléfono", "telefono")}
          {renderEditableItem("Delegación", "delegacion")}
          {renderEditableItem("Repartición", "reparticion")}
          {renderEditableItem("CUIL", "cuil")}
          {renderEditableItem("Rol", "rol")}
          {renderEditableItem("Apellido y Nombre", "apellidoYNombre")}
          {renderEditableItem("Situación de revista", "situacionDeRevista")}
          {renderEditableItem("Fecha de alta", "fecha")}
          {renderEditableItem("Concurso", "concurso")}
          {renderEditableItem("Resolución", "resolucion")}
          {/* {renderEditableItem(isCese ? "Fecha de Cese" : "Fecha de alta", "fecha")} */}

          <div className="md:col-span-2 lg:col-span-3">
            {renderEditableItem("CC", "cc")} 
          </div>
          
          <div className="md:col-span-2 lg:col-span-3">
            {renderEditableItem("Cargo a cubrir", "cargoACubrir")}
          </div>

          <div className="md:col-span-2 lg:col-span-3">
           {/*  {isCese ? (
              <>
                {renderEditableItem("Motivo de Cese", "motivoDeCese")}
                <div className="py-3 px-4 bg-gray-800 rounded-md mt-4">
                  <label className="text-sm font-medium text-gray-300">Bloqueo</label>
                  <input
                    type="text"
                    value={bloqueo}
                    onChange={(e) => setBloqueo(e.target.value)}
                    className="mt-1 w-full text-md text-white font-semibold break-words bg-transparent border-none focus:outline-none"
                    placeholder="Ingresa la CCOO de bloqueo..."
                    disabled={tipoMovimiento.includes("CON LICENCIA")}
                  />
                </div>
              </>
            ) : (
              renderEditableItem("Reemplaza a", "reemplazaA")
            )} */}
        </div>
      </dl>
      </div>
      <div className="mt-6 text-center">
      <button
        onClick={onReset}
        className="px-6 py-2 bg-brand-primary text-white font-semibold rounded-lg shadow-md hover:bg-brand-dark focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-brand-primary transition-all duration-200 dark:bg-blue-700 dark:hover:bg-blue-900"
      >
        Analizar otro FTW
      </button>
      </div>
    </div>
  );
};

export default ReportDisplay;